Differences between $or and $in when querying Strings in MongoDB / mongoose<p>While building an API, I need to match documents that contain <code>pending</code> or <code>active</code> values for the key <code>status</code>.</p>

<p>When trying </p>

<pre class="lang-js prettyprint-override"><code>args.status = {
  $or: [
    'active',
    'pending'
  ]
}
</code></pre>

<p>I get an error: <code>cannot use $or with string</code></p>

<p>However,</p>

<pre class="lang-js prettyprint-override"><code>args.status = {
  $in: [
    'active',
    'pending'
  ]
}
</code></pre>

<p>works just fine.</p>

<p>I would expect <code>$or</code> to work here. Can someone provide context on the differences between the two and why Strings require <code>$in</code>?</p>

