Spring mongo repository crud combined with criteria<p>I have the following two repository classes in my project.</p>

<pre><code>@Repository
public interface AuditRepository extends MongoRepository&lt;AuditEntity, String&gt; {
}
</code></pre>

<p>And also one that has more complex queries.</p>

<pre><code>@Service
public class AuditCriteriaRepository {

  private final MongoTemplate mongoTemplate;

  public AuditCriteriaRepository(MongoTemplate mongoTemplate){
    this.mongoTemplate = mongoTemplate;
  }


  public List&lt;AuditEntity &gt; getAuditEntitiesByStatus(AuditStatus auditStatus, Instant instant){
    Query query = new Query();
    query.addCriteria(Criteria.where("status")
        .is(auditStatus)
    ).addCriteria(Criteria.where("createdAt").lt(instant));
    return mongoTemplate.find(query, AuditEntity.class);
  }
}
</code></pre>

<p>The problem I have now is they are Autowired as separate classes and I would prefer if I could combine the two as one repository class so I can have the default crud options and build criteria ones also.</p>

<p>Any advice / tips on how to do that?</p>

