Some confusion about callbacks and .toArray in node.js<p>I did some work on an app and was told to go back and figure out why the tests are now failing.  In doing so, I came across some code that started confusing me.</p>

<p>This bit of code is supposed to find a device in the database with a serial number:</p>

<pre><code>exports.findBySerial = function (serial, cb) {
  db.devices.find({serial: serial}).toArray((err, count, myDevices) =&gt; {
    if (err) {
      return cb(err)
    }
    if (count.length === 0) {
      return cb(null, null)
    } else if (count.length === 1) {
      return cb(null, myDevices[0])
    } else {
      console.error('More than one device with serial no: ' + serial)
      return cb(err)
    }
  })
}
</code></pre>

<p>The first line uses a different call from the same device repository, <code>.find</code>:</p>

<pre><code>exports.find = function (search, sort, pagination, cb) {
  const curFind = db.devices.find(search).sort(sort)
  curFind.count((err, count) =&gt; {
    if (err) console.log(err)
    if (pagination) {
      curFind.skip((pagination.cp - 1) * pagination.pp).limit(pagination.pp).toArray((err, devices) =&gt; {
        if (err) {
          return cb(err)
        } else {
          return cb(null, count, devices)
        }
      })
    } else {
